Javascript/NodeJS: html rendering before .find finishes inside forEach<p>This loop is supposed to be checking for opps in the DB that match opps being pulled from the salesforce api results and then either creating a new opp or finding the existing opp and pushing it to the array. It seems that the res.render is running before the opp is found. It creates a new opp but the array returns empty when the page renders.</p>

<pre><code> Account.find({owner:req.user._id, prospect:'false'}).sort({ammount:'desc'}).populate({path: "notes", options:{ sort:{ 'date': -1 } } }).exec(function(err, allAccounts) {
        let callGoal = req.user.callGoal;
        if(err){
            res.send(err);
        }else{
            // if auth has not been set, redirect to index
            if (!req.session.accessToken || !req.session.instanceUrl) { res.redirect('/'); }
        //SOQL query
            let q = "SELECT Id,Amount,CloseDate,LastActivityDate,Name,StageName,account.Name FROM Opportunity WHERE CloseDate &lt; 2018-10-01 AND OwnerId = '0050a00000J12PdAAJ' AND IsClosed = false AND StageName != 'Stage 6: Won'";
        //instantiate connection
            let conn = new jsforce.Connection({
                oauth2 : {oauth2},
                accessToken: req.session.accessToken,
                instanceUrl: req.session.instanceUrl
           });
        //set records array
            let softopps = [];
            let sfOpps = [];
            let query = conn.query(q)
               .on("record", function(record) {
                 sfOpps.push(record);
               })
               .on("end", function() {
                 console.log("total in database : " + query.totalSize);
                 console.log("total fetched : " + query.totalFetched);
                 let user = req.user;
                 sfOpps.forEach(function(sfopp){
                     if(err){
                         res.send(err);
                     }else{
                         Opp.findOne({sfid:sfopp.Id}).exec(function(err, opp){
                         if(!opp.length){
                            Opp.create(req.body, function(err, newOpp) {
                                if(err){
                                    res.send(err)
                                }else{
                                    newOpp.sfid = sfopp.Id;
                                    newOpp.name = sfopp.Name;
                                    newOpp.owner = user.sfid;
                                    newOpp.save();
                                    return softopps.push(newOpp)
                                }
                            })
                         }else{
                             return softopps.push(opp);
                         }
                     })
                     }
                 })
                 res.render("myaccounts", {accounts:allAccounts, callGoal:callGoal, user:user, sfOpps:sfOpps, opps:softopps});
               })
               .on("error", function(err) {
                 console.error(err);
               })
               .run({ autoFetch : true, maxFetch : 4000 });
        }
    });
</code></pre>

