Is it possible to subscribe to a text search cursor in Meteor 1.7+<p>Previously, I used to write </p>

<pre><code>MyCollection.find({ $text: { $search: 'foo' } }, {
  fields: {
    score: { $meta: "textScore" }
  },
  sort: {
    score: { $meta: "textScore" }
  }
});
</code></pre>

<p>But, now I get an error</p>

<pre><code>I20180926-18:26:08.708(-4)? Exception from sub mysubscription id ZeSWJcoghED3t6Eq6 Error: Exception while polling query {"collectionName":"my-collection","selector":{"$text":{"$search":"foo"}},"options":{"transform":null,"limit":25,"sort":{"score":{"$meta":"textScore"}}}}: must have $meta projection for all $meta sort keys
I20180926-18:26:08.709(-4)?     at PollingObserveDriver._pollMongo (packages/mongo/polling_observe_driver.js:165:11)
I20180926-18:26:08.709(-4)?     at Object.task (packages/mongo/polling_observe_driver.js:93:12)
I20180926-18:26:08.710(-4)?     at Meteor._SynchronousQueue.SQp._run (packages/meteor.js:987:16)
I20180926-18:26:08.710(-4)?     at packages/meteor.js:964:12
</code></pre>

<p>As I try to find more information, <a href="https://stackoverflow.com/questions/48975707/mongoerror-must-have-meta-projection-for-all-meta-sort-keys-using-mongo-db-na">this answer</a> mentions that the <code>fields</code> parameter needs to be included in a projection, such as</p>

<pre><code>collection.find({
    $text:
      {
        $search: filter,
        $caseSensitive: false,
        $diacriticSensitive: true
      }
    })
    .project({ score: { $meta: "textScore" } })
    .sort({score:{$meta:"textScore"}})
</code></pre>

<p>However, Meteor does <strong>not</strong> have a <code>.project</code> method.</p>

<p>What's the solution?</p>

