How to specify key param order using Spring Data Mongo Mapper and composite key<p>I have a POJO that i would like to persist using a composite key to support multi region mongo distribution using where sharding is done first on region then on object id. To facilitate this, I created the following POJO:</p>

<pre><code>@Document("users")
public class User {
    @Id
    private Key id;
    ... // other irrelevant fields + getters/setters
}
</code></pre>

<p>The Key class looks like this:</p>

<pre><code>// Note the order of fields is region, then id
public class Key implements Serializable {
    private final @NotNull String region;
    private final @NotNull String id;
    public Key(@NotNull String region, @NotNull String id) {
        this.region = region;
        this.id = id;
    }
}
</code></pre>

<p>Unfortunately, when the Spring Data mapper converts this to a document it results in the following:</p>

<pre><code>{ "_id" : { "_id" : "12345", "region" : "us_west" } }
</code></pre>

<p>when I was expecting this (crucial due to db sharding):</p>

<pre><code>{ "_id" : { "region" : "us_west", "_id" : "12345" } }
</code></pre>

<p>One thing i observed is that the mapper seems to convert any Java fields titled "id" to "_id" and automatically move them to be first. This is precisely what i would like to prevent if possible. One workaround that i have found was to rename the second part of my key to "id2" like so:</p>

<pre><code>public class Key implements Serializable {
    private final @NotNull String region;
    private final @NotNull String id2;
    public Key(@NotNull String region, @NotNull String id2) {
        this.region = region;
        this.id2 = id2;
    }
}
</code></pre>

<p>This gave me a workable solution with the result of:</p>

<pre><code>{ "_id" : { "region" : "us_west", "id2" : "12345" } }
</code></pre>

<p>... however ideally i don't want to have to rename the fields as it impacts other areas of my code so I was wondering if there was a way to specify order of fields to the mapper with an annotation perhaps or to enforce POJO declaration order which is what i expected to happen in the first place?</p>

