Extract $graphLookup matches into documents<p>For context, I'm using MongoDB 3.6.4 and I'm trying to build a hierarchical schema for ACL permissions, but I'll boil the problem down and save the details.</p>

<p>Say I have a simple collection <code>C</code>, where <code>parents</code> is a list of references to other documents in <code>C</code>:</p>

<pre><code>{
  _id: ObjectId
  parents: Array(ObjectId)
}
</code></pre>

<p>If I do an aggregation like:</p>

<pre><code>[
  {
    $match: {_id: ObjectId("f00...")}
  },
  {
    $graphLookup: {
      from: "C",
      startWith: "$parents",
      connectFromField: "parents",
      connectToField: "_id",
      as: "graph"
    }
  }
]
</code></pre>

<p>I get back data like:</p>

<pre><code>{
  "_id": ObjectId("f00..."),
  "parents": [ObjectId("f01..."), ObjectId("f02..."), ...],
  "graph": [&lt;doc1&gt;, &lt;doc2&gt;, &lt;doc3&gt;, ...]
}
</code></pre>

<p>Is there a way to split the <code>graph</code> items out into documents? e.g. from the previous output example:</p>

<pre><code>{
  "_id": ObjectId("f00..."),
  "parents": [ObjectId("f01..."), ObjectId("f02..."), ...]
}
&lt;doc1&gt;
&lt;doc2&gt;
&lt;doc3&gt;
</code></pre>

