Returning Callback in Javascript<p>Taking inspiration from this answer <a href="https://stackoverflow.com/a/21571589/9036255">https://stackoverflow.com/a/21571589/9036255</a> I decided to copy this into my own code. I've found that it doesn't give any response.</p>

<pre><code>function getCallback(callbackTrash) {
    var Books = mongoose.model('Book');
    Books.find({'username': name[usernames]}, function (err, result) {
        callbackTrash(result);
    });
}

getCallback(function(result) {
    books.push(result);
});
</code></pre>

<p><code>books</code> is just an array. When I console log it later on, it returns "[]"</p>

<p>If I change <code>books.push</code> to <code>console.log</code>, it correctly logs all of the results.</p>

<p>My question is how to get the result to be pushed into the books array?</p>

<p>I have no experience with asynchronous things. What's a practical answer without a steep learning curve?</p>

<hr>

<p>Here's my greater context:</p>

<pre><code>exports.timeline = function(req, res) {
    var Followers = mongoose.model('Follow');
    Followers.find({'follower': req.user.username}, function(err, followerResult) {
        var name = [req.user.username];
        var books = [];

        function addName(username) {
            name.push(username);
        }

        for(var user in followerResult) {
            addName(followerResult[user]['followed']);
        }

        for(var usernames in name) {
            function getCallback(callbackTrash) {
                var Books = mongoose.model('Book');
                Books.find({'username': name[usernames]}, function (err, loadOfBollocks) {
                    callbackTrash(loadOfBollocks);
                });
            }

            getCallback(function(result) {
                books.push(result);
            });
        }

        console.log(books);
        res.send(books);
    });
}
</code></pre>

